from math import gcd
from sympy import divisors
def a(n): return sum(1 for d in divisors(n, generator=True) if 1 == gcd(d-1, n) == gcd(d+1, n))
print([a(n) for n in range(1, 91)]) # _Michael S. Branicky_, Sep 20 2025

